css:
@-moz-document url-prefix(https://gosupermodel.com/community/forum_thread.jsp?id=) {
	.wframes_content {
    background-color: #292929;
    color: #d9d9d9;
    padding: 7px;
    overflow: hidden;
    clear: both;
  }
  
	.wframes_content a {
    color: #ffffff;
	}
  
	a.avatar_shot_small_lnk div, a.avatar_shot_small div {
    background: url(https://i.snipboard.io/w126Ga.jpg) no-repeat;
  }
  
  div.forum_posts .post_by_focusgroup {
    background: #f0d7b978;
  }

	div.forum_posts .post_by_mod {
    background: #b1cfed7d;
  }
  
  
	div.forum_posts .post_by_socialitestar {
    background: #fffacd2e;
  }

  div.bubble b.bub2, .theme1 div.bubble b.bub3, .theme1 div.bubble b.bub4, .theme1 div.bubble div.bdiv {
    background-color: #e6e1dc57;
  }
  
  div.forum_posts .post_by_specialperson div.bubble b.bub2, div.forum_posts .post_by_specialperson div.bubble b.bub3, div.forum_posts .post_by_specialperson div.bubble b.bub4, div.forum_posts .post_by_specialperson div.bubble div.bdiv {
    background-color: #e6e1dc57;
  }



}
